  Pamela b. at Wanganui. Address: 7716 Helmore Street, Wanganui.
  Pamela was educated at Clifton House School, Wanganui Girls' College and Nga Tawa School, Marton. She
  served in the RNZAF (1943-45) then joined the staff of the Wanganui Public Library in 1946. In 1968, as
  Deputy City Librarian, she left to become the Librarian in Charge of the School Library Service of the
  National Library of New Zealand, retiring in 1984. Her interests include the Citizens' Advice Bureau,
  the Cancer Society of NZ and Save the Children Fund.
  05> MACLEAN, Eric Wanklyn m on 18.06.1924 to TURNER, May Harcourt
  b 13.07.1886 d 09.12.1940
  b 26.11.1892 d 24.06.1984
  Eric b. at Foxton and m. and d. at Wellington. May, d/o Charles Harcourt Turner
  and Annie Way. She was a great grand-daughter of Nathaniel Turner, a Methodist
  missionary, who came to New Zealand in 1823.
  Eric was educated at Wanganui Collegiate School and Emmanuel College, Cambridge.
  He was an engineer and managing director of J J Niven & Co, which he joined in
  1910. During ww1 he served in the NZ Expeditionary Force leaving with the main
